import React, {useState} from 'react';
import {Link} from 'react-router-dom';

function navbar() {
  return (
    <>
        <nav className="navbar">
            <div className="container">
                <Link to="/" className="navbar-logo">
                    TRVL <i className="fab fa-typo3"/>
                </Link>
            </div>
        </nav>
    </>
  )
}

export default navbar;
